import "./ExtendedNav.css";

import { CloseButton, Tooltip } from "@mantine/core";

import React from "react";

const ExtendedNav = ({ onClick }) => {
  return (
    <div className="extended-nav">
      <div className="close-button-container">
        <Tooltip
          className="close-button-tooltip"
          openDelay={500}
          closeDelay={500}
          label="Close"
          withArrow
        >
          <CloseButton
            size="xl"
            color="dark"
            iconSize={20}
            onClick={onClick}
            className="close-button"
          />
        </Tooltip>
      </div>
      <div className="extended-nav-items"></div>
    </div>
  );
};

export default ExtendedNav;
